  false,\n\t\"url\": null,\n\t\"notes\": \"Point and line coverage depicting several
  human-use, or socioeconomic features in the Cook Inlet/Kenai Peninsula region including
  oil facilities, oil platforms, aquaculture facilities and land ownerships. Source
  map scale is 1:63,360 for land ownership, 1:250,000 for point data and 1:100,000
  for roads. This coverage was updated from 1984 maps using resource data from various
  sources and then published on ESI summary map publication in 1995. NPS acquired
  this coverage from the Exxon Valdez Oil Spill \"Research and Restoration Information
  Project\" CD(ver.10).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
